import React from "react";
import "./App.css";
import Menu from "./Menu.js";
import styled from "styled-components";
import Avatar from '@material-ui/core/Avatar';

const MainContainer = styled.div`
  display: flex;
  flex-direction: column;
  min-height: 100vh;
`;
const StyledDiv1 = styled.div`
  flex: 1;
  background-color: #ffffff;
  display: flex;
  flex-direction: column;
`;

const Name = styled.h1`
  color: #5f5b6b;
  font-size: 4em;
  text-align: center;


`;

const NameDiv = styled.div`
flex: 1;
justify-content: center;
vertical-align: middle; 
`
const CactusDiv = styled.div`
flex: 1;
text-align: center;
margin: 0em;

`
const StyledDiv2 = styled.div`
  flex: 3;
`;


const Cactus = styled.img`
width: 20vw;
vertical-align: middle;
margin: 0em;
`

function App() {
  return (
    <MainContainer>
      <StyledDiv1>
        <NameDiv>
        <Name>Katherine Szelag</Name>
        </NameDiv>

       <CactusDiv>
       <Cactus alt="cactus" src="https://res.cloudinary.com/dpfixnpii/image/upload/v1583285687/kisspng-cactaceae-sticker-flowerpot-adobe-illustrator-cactus-5a9803d4412093.6118392815199118922668_minpaf.png"/>
       </CactusDiv>

      </StyledDiv1>
      <StyledDiv2>
        <Menu />
      </StyledDiv2>
    </MainContainer>
  );
}

export default App;
